import React  from 'react'
import './Header.css'
import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import Button from '@mui/material/Button';
import List from '@mui/material/List';
import Divider from '@mui/material/Divider';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import InboxIcon from '@mui/icons-material/MoveToInbox';
import MailIcon from '@mui/icons-material/Mail';

const Header = () => {

  return (
    <header>
       <div>
        {['X'].map((anchor) => (
          <React.Fragment key={anchor}>
            <Button onClick={toggleDrawer(anchor, true)}>{anchor}</Button>
            <Drawer
              anchor={anchor}
              open={state[anchor]}
              onClose={toggleDrawer(anchor, false)}
            >
              {list(anchor)}
            </Drawer>
          </React.Fragment>
        ))}
       </div>
        <div className="container">
            <div className="row py-4 justify-content-between">
                <div className="left col-lg-3 col-5">
                    <img src="data:image/webp;base64," alt="" />
                </div>
                <div className="row center col-lg-6">
                    <div className="all-link">
                        <a href="">Home</a>
                        <a href="">Shop</a>
                        <a className="red" href="">Sale</a>
                        <a href="">Features</a>
                        <a href="">Blog</a>
                        <a href="">About</a>
                        <a href="">Contact</a>
                    </div>
                </div>
                <div className="right col-lg-3 text-end col-5 justify-content-between">
                    <i className="fa-solid fa-circle-user mx-4"></i>
                    <i className="fa-solid fa-bag-shopping second"></i>
                    <i className="fa-solid fa-bars res"></i>
                </div>
            </div>
        </div>
    </header>
  )
}

export default Header
